// src/pages/Cart.jsx
import { useCart } from "../context/CartContext";
import { motion } from "framer-motion";

export default function Cart() {
    const { cart, removeFromCart, updateQuantity, clearCart } = useCart();

    const totalPrice = cart.reduce((sum, book) => {
        const price = parseFloat(book.price) || 0;
        return sum + price * book.quantity;
    }, 0);

    // ‚úÖ ÿ±ÿßÿ®ÿ∑ ÿ≠ÿ¨ÿ≤ ŸÉŸÑ ÿßŸÑŸÉÿ™ÿ®
    const whatsappMessage = cart
        .map((book) => `üìö ${book.title} - ${book.price} √ó ${book.quantity}`)
        .join("\n");

    const whatsappUrl = `https://wa.me/201234567890?text=ŸÖÿ±ÿ≠ÿ®Ÿãÿßÿå ÿ£ŸàÿØ ÿ≠ÿ¨ÿ≤ Ÿáÿ∞Ÿá ÿßŸÑŸÉÿ™ÿ®:\n${encodeURIComponent(
        whatsappMessage
    )}\n\nÿßŸÑÿ•ÿ¨ŸÖÿßŸÑŸä: ${totalPrice.toFixed(2)} ÿ¨.ŸÖ`;

    return (
        <main className="max-w-6xl mx-auto px-4 py-10 text-right font-sans">
            <motion.h1
                initial={{ opacity: 0, y: -20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6 }}
                className="text-3xl font-bold text-blue-800 mb-8"
            >
                üõí ÿ≥ŸÑÿ© ÿßŸÑÿ™ÿ≥ŸàŸÇ
            </motion.h1>

            {cart.length === 0 ? (
                <p className="text-gray-600 text-lg text-center py-10">
                    üì≠ ÿßŸÑÿ≥ŸÑÿ© ŸÅÿßÿ±ÿ∫ÿ© ÿ≠ÿßŸÑŸäÿßŸã.
                </p>
            ) : (
                <div className="space-y-6">
                    {cart.map((book) => {
                        const singleBookUrl = `https://wa.me/201234567890?text=ŸÖÿ±ÿ≠ÿ®Ÿãÿßÿå ÿ£ŸàÿØ ÿ≠ÿ¨ÿ≤ ÿßŸÑŸÉÿ™ÿßÿ®:\nüìñ ${book.title}\nüíµ ${book.price}`;
                        return (
                            <div
                                key={book.id}
                                className="flex flex-col md:flex-row items-start gap-6 bg-white shadow rounded-lg p-4"
                            >
                                <img
                                    src={book.images?.[0] || "/placeholder.png"}
                                    alt={book.title}
                                    className="w-full md:w-32 h-56 object-cover rounded border"
                                />
                                <div className="flex-1 space-y-2">
                                    <h2 className="text-xl font-semibold text-blue-800">
                                        {book.title}
                                    </h2>
                                    <p className="text-gray-600">‚úçÔ∏è {book.author}</p>
                                    <p className="text-green-700 font-semibold">
                                        üíµ {book.price}
                                    </p>

                                    <div className="flex items-center gap-2 mt-3">
                                        <label className="text-gray-700">ÿßŸÑŸÉŸÖŸäÿ©:</label>
                                        <input
                                            type="number"
                                            min="1"
                                            value={book.quantity}
                                            onChange={(e) =>
                                                updateQuantity(book.id, parseInt(e.target.value))
                                            }
                                            className="w-16 border rounded p-1 text-center"
                                        />
                                    </div>

                                    <div className="flex gap-4 mt-3">
                                        {/* ‚úÖ ÿ≤ÿ± ÿßŸÑÿ≠ÿ¨ÿ≤ ÿßŸÑŸÅÿ±ÿØŸä */}
                                        <a
                                            href={singleBookUrl}
                                            target="_blank"
                                            rel="noopener noreferrer"
                                            className="text-sm bg-green-500 hover:bg-green-600 text-white px-3 py-2 rounded shadow"
                                        >
                                            üì≤ ÿ≠ÿ¨ÿ≤ Ÿáÿ∞ÿß ÿßŸÑŸÉÿ™ÿßÿ®
                                        </a>

                                        {/* ÿ≤ÿ± ÿßŸÑÿ•ÿ≤ÿßŸÑÿ© */}
                                        <button
                                            onClick={() => removeFromCart(book.id)}
                                            className="text-red-600 hover:text-red-800"
                                        >
                                            üóëÔ∏è ÿ•ÿ≤ÿßŸÑÿ©
                                        </button>
                                    </div>
                                </div>
                            </div>
                        );
                    })}

                    {/* ‚úÖ ÿßŸÑÿ•ÿ¨ŸÖÿßŸÑŸä + ÿ≤ÿ± ÿ≠ÿ¨ÿ≤ ŸÉŸÑ ÿßŸÑÿ≥ŸÑÿ© */}
                    <div className="flex flex-col md:flex-row justify-between items-center bg-gray-100 p-4 rounded-lg gap-4">
                        <p className="text-xl font-bold text-blue-800">
                            ÿßŸÑÿ•ÿ¨ŸÖÿßŸÑŸä: {totalPrice.toFixed(2)} ÿ¨.ŸÖ
                        </p>
                        <div className="flex gap-4">
                            <button
                                onClick={clearCart}
                                className="bg-red-500 hover:bg-red-600 text-white px-4 py-2 rounded"
                            >
                                ÿ•ŸÅÿ±ÿßÿ∫ ÿßŸÑÿ≥ŸÑÿ©
                            </button>
                            <a
                                href={whatsappUrl}
                                target="_blank"
                                rel="noopener noreferrer"
                                className="bg-green-600 hover:bg-green-700 text-white px-6 py-2 rounded-lg shadow"
                            >
                                üì¶ ÿ≠ÿ¨ÿ≤ ÿßŸÑŸÖÿ¨ŸÖŸàÿπÿ© ŸÉÿßŸÖŸÑÿ©
                            </a>
                        </div>
                    </div>
                </div>
            )}
        </main>
    );
}
